        content:
          '{\n  "name": "Crossroads Plumbing",\n  "formatted_address": "63 Spencer Rd, Killara NSW 2071, Australia",\n  "location": {\n    "lat": -33.7669337,\n    "lng": 151.1486261\n  },\n  "formatted_phone_number": "0447 302 071",\n  "website": "http://www.crossroadsplumbing.com.au/",\n  "rating": 5,\n  "reviews": [\n    {\n      "author_name": "GiGi",\n      "author_url": "https://www.google.com/maps/contrib/107595933254177774256/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocK6_sOcSRmW8eVMz79oTDAM38YzBJYMauGj7UG6RBCx0vqBUA=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "a month ago",\n      "text": "Absolutely fabulous job done by Tom, Matt and Chris from Crossroads Plumbing!!!\\n\\nAt first, we had Tom come to Pymble to fix our leaking tap in the bathroom. As he was very professional, efficient and responsible, we asked him to replace all toilet suites and all basin sets. We also had him install a new kitchen mixer and a food disposal unit. It involved lots of work, but Tom, Matt and Chris completed them so well in a short period of time.\\n\\nThey even did a detailed cleaning after finishing their job! In short, they are very trustworthy! They made our life better and easier. Highly recommended!!!",\n      "time": 1747284462,\n      "translated": false\n    },\n    {\n      "author_name": "Angie G",\n      "author_url": "https://www.google.com/maps/contrib/110795564350566954295/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocJ5gMIQn2AXjJMh5apsos-tIuPIplIpuQfm4HdBvS6-D2WajQ=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "5 months ago",\n      "text": "Tom worked with another painting company to help project manage repairs and upgrades to my bathroom in my small lower north shore apartment. He sourced all parts making it so much easier. Now it looks as good as new, without the hefty price tag that comes with a full Reno. Tom is professional, friendly, reliable and was great with my dog. Highly recommend him and Crossroads Plumbing",\n      "time": 1737432309,\n      "translated": false\n    },\n    {\n      "author_name": "Thomas Chan",\n      "author_url": "https://www.google.com/maps/contrib/101751304452864523421/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXPkc3pljOXKrXmFfhcyCFBNy9OE53D4Au-JmhChC0_-TfGbiw6=s128-c0x00000000-cc-rp-mo-ba4",\n      "rating": 5,\n      "relative_time_description": "a month ago",\n      "text": "Highly recommend Crossroads Plumbing and Tom for their excellent service! Tom supplied and installed a new water pressure pump and a Toto bidet toilet for us. The difference is amazing \u2013 we can finally enjoy a strong, hot shower, and the new bidet toilet is much more effective and hygienic. Professional, efficient, and quality workmanship from start to finish. Thank you, Tom!",\n      "time": 1748697405,\n      "translated": false\n    },\n    {\n      "author_name": "Mony Sahota",\n      "author_url": "https://www.google.com/maps/contrib/113342691657024737224/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLBeQzR0O2DNBJkFGNLD7iCwwmzMGgtTteAnn1Fx5sFusOiuQ=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "a week ago",\n      "text": "An excellent experience with Tom in dealing with a blocked drain on a Friday.  Job was completed in full the next business day.\\nClear communication and variety of options / solutions given.\\nSite was left clean and tidy with dug up grassed site restored . I highly recommend Crossroads Plumbing and in particular all dealings with Tom - upfront and honest and very professional.",\n      "time": 1750742574,\n      "translated": false\n    },\n    {\n      "author_name": "Yongxue Li",\n      "author_url": "https://www.google.com/maps/contrib/101992119034629438231/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUU2u4XoKBgNnZ4eDTd-ky1EFNjf8Y6aMj_D8Rz2oIGUvlR7Qi_=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "4 months ago",\n      "text": "Highly recommend Crossroads Plumber Pty Ltd and Mr. Matt!\\nI purchased two Elong BMH toilet suites with Toto S7 washlets, but the water point needed modification. The installation was done professionally and efficiently. My home is located  in Pyrmont, I highly recommend their services for quality plumbing work.",\n      "time": 1740446048,\n      "translated": false\n    }\n  ],\n  "opening_hours": {\n    "open_now": true,\n    "periods": [\n      {\n        "open": {\n          "day": 0,\n          "time": "0000"\n        }\n      }\n    ],\n    "weekday_text": [\n      "Monday: Open 24 hours",\n      "Tuesday: Open 24 hours",\n      "Wednesday: Open 24 hours",\n      "Thursday: Open 24 hours",\n      "Friday: Open 24 hours",\n      "Saturday: Open 24 hours",\n      "Sunday: Open 24 hours"\n    ]\n  }\n}',
