        content:
          '{\n  "name": "Purified Plumbing",\n  "formatted_address": "5 Janet Ave, Thornleigh NSW 2120, Australia",\n  "location": {\n    "lat": -33.7287391,\n    "lng": 151.0790248\n  },\n  "formatted_phone_number": "1300 663 667",\n  "website": "https://www.purifiedplumbing.com/",\n  "rating": 4.8,\n  "reviews": [\n    {\n      "author_name": "Marc de Silva",\n      "author_url": "https://www.google.com/maps/contrib/109124965109330517760/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVMmsaElcC5APjwy8ZkJJYa8tonu9xziiB1L3lAqY0SblSC0DFZ=s128-c0x00000000-cc-rp-mo-ba4",\n      "rating": 5,\n      "relative_time_description": "4 months ago",\n      "text": "Very prompt service - made the call in the morning and Dave was out here by lunch time.  Lucky I saved that fridge magnet!!  What i thought would be simple turned out to be a little complex and needed a plumber to fix (rather than a wannabe home handy man).  Dave was friendly polite and very efficient and included a quick plumbing safety check.  Not sure how price would compare to other outfits but the job is done and cistern works well.  Will defo use them again.",\n      "time": 1741055244,\n      "translated": false\n    },\n    {\n      "author_name": "David Dean",\n      "author_url": "https://www.google.com/maps/contrib/115793772761330733698/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocKA7uH1NALDIR8DznNVZlx-yC7W2spuCW9G9nDKShRVe3HC_Q=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "3 months ago",\n      "text": "I have used purified plumbing on multiple occasions. Each time they have been on time, polite and diagnose the issue very efficiently.\\nTheir communication with me about the job has been excellent and allows me to understand the issue and what needs to be done to have it rectified.\\nWill definitely be using them for all my plumbing needs.",\n      "time": 1741309060,\n      "translated": false\n    },\n    {\n      "author_name": "Hody Wai",\n      "author_url": "https://www.google.com/maps/contrib/109824749587819165405/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUIFH2Zj7TpbhegMfDfdIq0QDdiEeXEy2yGifmjA7y5r44XLxNd=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "3 months ago",\n      "text": "Had a good experience with Purified plumbing. Ben responded quickly after my online request. He arrived on time and accessed my hot water system. Explained the situation to me and solved the issue quickly.Highly recommend.",\n      "time": 1743124478,\n      "translated": false\n    },\n    {\n      "author_name": "Shannon Ryan",\n      "author_url": "https://www.google.com/maps/contrib/103672307347255725771/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocJYaBNCIJCm9zkRnxeRsj-K2ZfdKYaI5V28m3fDOQLunSUpnQ=s128-c0x00000000-cc-rp-mo",\n      "rating": 5,\n      "relative_time_description": "5 months ago",\n      "text": "Had a few plumbing issues and made a booking with Purified Plumbing - very happy with the service. It was clear some additional work was required and the parts were sourced and it all done in one visit. It was easy to book and they were available at a time that was good for me and were on time. Definitely recommend them",\n      "time": 1737443532,\n      "translated": false\n    },\n    {\n      "author_name": "Jasmine Gujral",\n      "author_url": "https://www.google.com/maps/contrib/100006053838203596507/reviews",\n      "language": "en",\n      "original_language": "en",\n      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLYAuuRohUEGD9xN2nj0fORKT9_cesFholVsbzFhJ5p6xGKPg=s128-c0x00000000-cc-rp-mo-ba2",\n      "rating": 5,\n      "relative_time_description": "3 months ago",\n      "text": "Dave was super efficient and fixed our leaking washer in no time. He even gave all of our other taps a good look as we had just moved in to this house. Would highly recommend anyone looking for reliable plumbing services.",\n      "time": 1741301615,\n      "translated": false\n    }\n  ],\n  "opening_hours": {\n    "open_now": true,\n    "periods": [\n      {\n        "open": {\n          "day": 0,\n          "time": "0000"\n        }\n      }\n    ],\n    "weekday_text": [\n      "Monday: Open 24 hours",\n      "Tuesday: Open 24 hours",\n      "Wednesday: Open 24 hours",\n      "Thursday: Open 24 hours",\n      "Friday: Open 24 hours",\n      "Saturday: Open 24 hours",\n      "Sunday: Open 24 hours"\n    ]\n  }\n}',
